import { initializeApp } from 'firebase/app'
import { getDatabase } from 'firebase/database'
import { getAnalytics } from 'firebase/analytics'

function StartFirebase() {
  const firebaseConfig = {
    apiKey: 'AIzaSyCv9JyT3LqUI965hFiMZ1wtjuorCOZ7oTg',
    authDomain: 'teste-ecolli.firebaseapp.com',
    databaseURL: 'https://teste-ecolli-default-rtdb.firebaseio.com',
    projectId: 'teste-ecolli',
    storageBucket: 'teste-ecolli.appspot.com',
    messagingSenderId: '445164928000',
    appId: '1:445164928000:web:2a8687599b1078d1022ce5',
    measurementId: 'G-SB492HNPM2'
  }

  // Initialize Firebase
  const app = initializeApp(firebaseConfig)
  const analytics = getAnalytics(app)

  return getDatabase(app)
}

export default StartFirebase
